import React from "react";
import "./App.css";
import { ChakraProvider, Button } from "@chakra-ui/react";
import theme from "./thema/thema";

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Button>ボタン</Button>
      <p>あああ</p>
    </ChakraProvider>
  );
}

export default App;
